<template>
	<div id="jspdfjs">
		<input type="number" v-model="firstPage">
		<input type="number" v-model="pages">
		<button @click="create">Ok</button>	
	</div>
</template>

<script>
	import JsPDF from '../../static/jspdf.min.js'

	export default {
		name: 'jspdfjs',
		data() {
			return {
				firstPage: 0,
				pages: 0
			}
		},
		methods: {
			create: function() {
				const doc = new JsPDF()
				const imgData = 'data:image/jpeg;base64,'
				let total = parseInt(this.firstPage) + parseInt(this.pages)
				for (let x = 0; x <= this.pages; x++) {
					doc.addImage(imgData, 'JPEG', 180, 2, 28, 28)
					doc.text(total.toString(), 190, 13)
					doc.addPage()
					total--
				}
				doc.save('a4.pdf')
			}
		}
	}
</script>

<style>
	@import url('../../static/bootstrap/css/bootstrap.min.css');

</style>
